import styled from 'styled-components';

export const CheckoutPageContainer = styled.div`
    min-height: 70vh;
    width: 55%;
    margin: 5rem auto 0;
`;

export const CheckoutPageEmpty = styled.h2`
    font-size: 3rem;
    font-weight: normal;
    margin: auto;
    width: fit-content;
`;

export const StripeButtonContainer = styled.div`
    text-align: right;
    margin-top: 2rem;
`;
